import "./Button.css";
import arrow from "./arrowright.svg";

function Button({ texto = "Mensaje no seteado", onClick = null } = {}) {
	return (
		<button className="Buttonjs" type="button">
			<p>{texto}</p>
			<img src={arrow} alt="generar" />
		</button>
	);
}
export default Button;
